import React from "react";
import DonorNav from './Nav'
import login_img from '../img/login_img.jpeg';
class Donor extends React.Component {
  constructor(props) {
    super(props);

  }
  render() {
    return (
      <div class="home">
          <DonorNav/>
          <div class="image">
                <a class="btn" href="/login"><span>Register/Login </span></a>
            </div>
      </div>
    );
  }
}
export default Donor
